import React, {Component} from 'react'
import Cards from "./card"

class Cardss extends Component{
    render(){
        return(
           <div className="row">
               <div className="col-md-4">
                  {Cards.Children}
               </div>
               <div className="col-md-4">
                  {Cards.Children}
               </div>
               <div className="col-md-4">
                  {Cards}
               </div>
           </div> 
        );
    }
}

export default Cardss;
